// PARAM: The state space is partitioned into uniformly sized squares of size G*G. 
// Partitions are addressed by their index for each axis. Since the state space is bounded there is only a finite amount of partitions.
const double G = 0.5;

// PARAM: Whether - after each action - to pick another random point within the partition the system ended up in.
const bool randomizeWithinPartition = true;

// PARAM: Whether to pick a random initial location for v and p
const bool randomizeInitial = false;

// PARAM: Possible initial state when randomizing completely
const double v_min = -15;
const double v_max = 15;
const double p_max = 15;

// Indices of the partition which contain v and p.
int iv, ip;

// The lower bound for v and the lower bound for p. The upper bound is vl + G etc.
double vl, vu, pl, pu;

// Change v and p to some random value sampled uniformly from within their partition 
void gridify()
{
    iv = fint(floor(v/G));
    ip = fint(floor(p/G));

    vl = iv*G;
    vu = vl + G;
    pl = ip*G;
    pu = pl + G;

    if (randomizeWithinPartition)
    {
        v = vl + random(G);
        p = pl + random(G);
    }
}

void initialize()
{
    if (randomizeInitial)
    {
        v = v_min + random(v_min + v_max);
        p = random(p_max);
    } 
    else
    {
        v = 0;
        p = 3 + random(7.0);
    }
    gridify();
}
